import ReactDom from 'react-dom';
import App from './Components/App'
import { React, ReactDOM } from 'react';


const root = ReactDOM.createRoot(document.getElementById('root'));
root.render(
  <React.StrictMode>
    <App/>
  </React.StrictMode>
);

ReactDom.render(<App />, document.querySelector('.root'));
